import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import Card from './Card';
import reportWebVitals from './reportWebVitals';
import 'tachyons';
import { characters } from './characters';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <div>
      <Card id={robots[0].id} name={robots[0].name} email={characters[0].email} />
      <Card id={robots[1].id} name={robots[1].name} email={characters[1].email} />
      <Card id={robots[2].id} name={robots[2].name} email={characters[2].email} />
      <Card id={robots[3].id} name={robots[3].name} email={characters[3].email} />
    </div>
  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
